import React from 'react';
import {Container,Row,Col} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import "./css/GridLay.css";
import prod1 from "./images/prod1.gif";


function GridLay(){
    return(
     <div id="Grid" >
         <Container  >
             <Row>
                 <Col lg={6}>
                    <img src={prod1}></img>
                 </Col>
                 <Col lg={6}>
                 <img src={prod2}></img>
                 </Col>
             </Row>
         </Container>

        
         <Container  >
             <Row>
                 <Col lg={6}>
                 <img src={prod3}></img>
                 </Col>
                 <Col lg={6}>
                 <img src={prod4}></img>
                 </Col>
             </Row>
         </Container>

        
     </div>
    ) ;
 }
 export default GridLay;
